function whileNumbers() {
  let allSquares = false;

  while (!allSquares) {
    differentNumbers();
    allSquares = true;
    document.querySelector('.sudoku').querySelectorAll('div').forEach(element => {
      if (element.innerText === '') {
        allSquares = false;
      }
    });

    if (!allSquares) {
      document.querySelector('.sudoku').querySelectorAll('div').forEach(element => {
        element.innerText = '';
      });
    }

    console.log('.');
  }

  return;
}

